script: |
  super -f text -I q9066.spq | sort > q9066.out

inputs:
  - name: q9066.spq
    data: |
      SELECT ALL - 31 FROM tab0 (FORMAT parquet) AS cor0 WHERE col0 - + - col2 * + col1 + + - col2 NOT BETWEEN NULL AND col2;
  - name: tab0

outputs:
  - name: q9066.out
    data: |
      -31
      -31
